import React from "react";
import Link from "next/link";

import { Menu, Button } from "antd";
import {
  HomeOutlined,
  AppstoreOutlined,
  SmileOutlined
} from "@ant-design/icons";

const Nav = ({ categories }) => {
  return (
    <Menu mode="horizontal">
      <Menu.Item key="mail" icon={<HomeOutlined />}>
        <Link href="/">
          <a>Home</a>
        </Link>
      </Menu.Item>
      <Menu.Item key="app" icon={<SmileOutlined />}>
        <Link href="/about">
          <a>About</a>
        </Link>
      </Menu.Item>

      {categories.map((category) => {
        return (
          <Menu.Item key={category.id} icon={<AppstoreOutlined />}>
            <Link as={`/category/${category.id}`} href="/category/[id]">
              <a>{category.name}</a>
            </Link>
          </Menu.Item>
        );
      })}
    </Menu>
  );
};

export default Nav;

